    startMusicAndEvents() {
      console.log("音乐和事件将在 " + this.MUSIC_START_DELAY_MS + "ms 后开始...");
      Laya.timer.clearAll(this);
      Laya.timer.once(this.MUSIC_START_DELAY_MS, this, () => {
        console.log("音乐开始播放...");
        this.musicChannel = Laya.SoundManager.playMusic(this.musicUrl, 1);
        Laya.timer.loop(10, this, this.checkMidiEvents);
      });
    }
    checkMidiEvents() {
      if (!this.musicChannel) {
        return;
      }
      const currentTime = this.musicChannel.position;
      while (this.currentEventIndex < this.eventData.length) {
        const event = this.eventData[this.currentEventIndex];
        if (currentTime >= event.time) {
          const durationMs = event.duration * 1e3;
          this.handleNoteEvent(event.note, durationMs);
          this.currentEventIndex++;
        } else {
          break;
        }
      }
      if (this.currentEventIndex >= this.eventData.length) {
        console.log("所有事件已播放完毕。");
        Laya.timer.clear(this, this.checkMidiEvents);
      }
    }
    getAllNotesFromTracks(data) {
      let allNotes = [];
      if (data.tracks) {
        data.tracks.forEach((track) => {
          if (track.notes) {
            allNotes = allNotes.concat(track.notes);
          }
        });
      }
      return allNotes;
    }
    createUnifiedEventData(data, notes) {
      const unifiedEvents = [];
      const ppq = data.header.ppq;
      const tempoEvents = data.header.tempos.sort((a, b) => a.ticks - b.ticks);
      const noteEvents = notes.sort((a, b) => a.ticks - b.ticks);
      let currentBpm = tempoEvents.length > 0 ? tempoEvents[0].bpm : 120;
      let tempoIndex = 0;
      let lastTicks = 0;
      let currentTime = 0;
      let noteIndex = 0;
      let isDone = false;
      while (!isDone) {
        let nextTempoEvent = tempoIndex < tempoEvents.length ? tempoEvents[tempoIndex] : null;
        let nextNoteEvent = noteIndex < noteEvents.length ? noteEvents[noteIndex] : null;
        if (!nextTempoEvent && !nextNoteEvent) {
          isDone = true;
          continue;
        }
        if (nextTempoEvent && (!nextNoteEvent || nextTempoEvent.ticks <= nextNoteEvent.ticks)) {
          const deltaTicks = nextTempoEvent.ticks - lastTicks;
          currentTime += deltaTicks / ppq * (60 / currentBpm);
          currentBpm = nextTempoEvent.bpm;
          lastTicks = nextTempoEvent.ticks;
          tempoIndex++;
        } else if (nextNoteEvent) {
          const deltaTicks = nextNoteEvent.ticks - lastTicks;
          currentTime += deltaTicks / ppq * (60 / currentBpm);
          unifiedEvents.push({
            type: "note",
            ticks: nextNoteEvent.ticks,
            time: currentTime,
            note: nextNoteEvent.name,
            duration: nextNoteEvent.duration
          });
          lastTicks = nextNoteEvent.ticks;
          noteIndex++;
        }
      }
      return unifiedEvents;
    }
    handleNoteEvent(noteName, durationMs) {
      const midiNumber = this.noteToMidi(noteName);
      const matchingPointIndex = this.findPointIndexByMidi(midiNumber);
      if (matchingPointIndex !== -1) {
        const point = this.intersectionPoints[matchingPointIndex];
        const pointData = this.intersectionPointsData[matchingPointIndex];
        console.log(`在 ${this.musicChannel.position.toFixed(2)}s 触发音符: ${noteName}, 对应点索引: ${matchingPointIndex}`);
        this.highlightAndResetElements(point, pointData.orbitIndex, durationMs);
      } else {
        console.warn(`音符 ${noteName} 未能映射到任何点。MIDI数字: ${midiNumber}`);
      }
    }
    highlightAndResetElements(point, orbitIndex, durationMs) {
      const line = this.orbitLines[orbitIndex];
      if (!point || !line)
        return;
      Laya.Tween.clearAll(point);
      Laya.Tween.clearAll(line);
      Laya.Tween.to(point, { alpha: 1, scaleX: 1.5, scaleY: 1.5 }, this.TWEEN_DURATION, Laya.Ease.sineOut);
      const rad = orbitIndex * (360 / this.ORBIT_COUNT) * Math.PI / 180;
      const endX = Math.cos(rad) * this.ringRadius * 1.5;
      const endY = Math.sin(rad) * this.ringRadius * 1.5;
      line.graphics.clear();
      line.graphics.drawLine(0, 0, endX, endY, this.getOrbitColor(orbitIndex), 3);
      Laya.Tween.to(line, { alpha: 1 }, this.TWEEN_DURATION, Laya.Ease.sineOut);
      const holdDuration = Math.max(this.MIN_HIGHLIGHT_DURATION, durationMs);
      Laya.timer.once(holdDuration, this, () => {
        Laya.Tween.to(point, { alpha: 0.01, scaleX: 1, scaleY: 1 }, this.TWEEN_DURATION, Laya.Ease.sineOut);
        Laya.Tween.to(line, { alpha: 0.2 }, this.TWEEN_DURATION, Laya.Ease.sineOut, Laya.Handler.create(this, () => {
          line.graphics.clear();
          line.graphics.drawLine(0, 0, endX, endY, "#ffffff", 1);
        }));
      });
    }
    noteToMidi(note) {
      const names = ["C", "C#", "D", "D#", "E", "F", "F#", "G", "G#", "A", "A#", "B"];
      const octave = parseInt(note.slice(-1));
      const noteName = note.slice(0, -1);
      const noteIndex = names.indexOf(noteName);
      if (noteIndex === -1) {
        return -1;
      }
      return noteIndex + (octave + 1) * 12;
    }
