      this.spiralLine.pos(Laya.stage.width / 2, Laya.stage.height / 2);
      Laya.stage.addChildAt(this.spiralLine, 1);
      const outerRadius = this.ringRadius;
      const totalAngle = this.SPIRAL_REVOLUTIONS * 2 * Math.PI;
      const pointArray = [];
      for (let i = 0; i <= 1e3; i++) {
        const t = i / 1e3;
        const angle = t * totalAngle;
        const r = this.INNER_RADIUS + (outerRadius - this.INNER_RADIUS) * t;
        pointArray.push(Math.cos(angle) * r, Math.sin(angle) * r);
      }
