      const dx = e.stageX - this.centerPoint.x;
      const dy = e.stageY - this.centerPoint.y;
      const currentAngleRad = Math.atan2(dy, dx);
      const currentAngleDeg = (currentAngleRad * 180 / Math.PI + 90 + 360) % 360;
      if (this.mousePreviousAngle === 0) {
        this.mousePreviousAngle = currentAngleDeg;
      }
      let angleDelta = currentAngleDeg - this.mousePreviousAngle;
      if (angleDelta > 180)
        angleDelta -= 360;
      if (angleDelta < -180)
        angleDelta += 360;
      this.mouseTotalRotation += angleDelta;
      this.mousePreviousAngle = currentAngleDeg;
      const innerRadius = 50;
